import React from 'react';
import ReturnlAstFx from './LastFx';
import { useNavigate } from 'react-router-dom';
import { auth } from '../firebase';
import { gsap, Expo } from 'gsap';

// Main LastFx
export default function LAstFx() {

 const navigation = useNavigate();
 const user = auth.currentUser;

 React.useEffect(() => {
  user != null ? window.console.log(true) : navigation('/');

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: .5, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnlAstFx />
  </>
 );
};
